import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../css/accordian.css';

function Accordian() {
   //dummy data object
   const request = {
        id: Date.now(),
        dateCreated: "09/01/2021",
        dateAwarded: "",
        demographics: {
            firstname: "Philip",
            lastname: "Smith",
            phone: "111-111-1111",
            email: "phil.smith@revature.net"
        },
        event: {
            eventType: "Graduation",
            cost: 500,
            gradingFormat: "Letter",
            gradeCutOff: "D",
            location: "Remote",
            startDate: "25/01/2021",
            endDate: "25/01/2021",
            description: "My graduation, yay!"
        },
        justification: "It is expensive.",
        attachments: "None",
        requestInfo: "",
        resubmitInfo: "",
        rejectInfo: "",
        statusOf: "Requested"
    };

    return (
        <Container fluid id="accordian">
            <Row>
                <Col>{request.dateCreated}</Col>
                <Col>{request.demographics.firstname} {request.demographics.lastname}</Col>
                <Col>{request.statusOf}</Col>
                <Col><NavLink>Edit</NavLink></Col>
            </Row>
        </Container>
    );

};

export default Accordian;
